import React from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: "id", 
    headerName: "ID", 
    width: 100,
    editable: false
  },
  {
    field: "amount",
    headerName: "Prezzo",
    width: 150,
    editable: false
  },
  {
    field: "currency",
    headerName: "Valuta",
    width: 150,
    editable: false
  },
  {
    field: "title",
    headerName: "Nome",
    type: "number",
    width: 150,
    editable: false
  }
];

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch("https://www.binance.com/bapi/nft/v1/public/nft/product-list", {
      "headers": {
        "accept": "*/*",
        "accept-language": "it-IT,it;q=0.9,en-US;q=0.8,en;q=0.7",
