        "lang": "en",
        "sec-fetch-dest": "empty",
        "sec-fetch-mode": "cors",
        "sec-fetch-site": "same-origin",
        "sec-gpc": "1",
        "x-trace-id": "628d832a-f923-4eb1-851c-717006c7ddaf",
        "x-ui-request-trace": "628d832a-f923-4eb1-851c-717006c7ddaf",
        "cookie": "cid=forA6zjn; bnc-uuid=8f4fb583-8175-4258-ac46-159f30f01411; source=organic; campaign=www.google.com; fiat-prefer-currency=EUR; nft-init-compliance=true; home-ui-ab=B; isAccountsLoggedIn=y; lang=it; userPreferredCurrency=EUR_USD; BNC_FV_KEY=3136771bac4babbe9b571f7c39bbab26e305dd80; BNC_FV_KEY_EXPIRE=1627549151381; sensorsdata2015jssdkcross=%7B%22distinct_id%22%3A%2272530447%22%2C%22first_id%22%3A%221775a1b52a7957-06b8150f14079a-6915227c-2621440-1775a1b52a9b92%22%2C%22props%22%3A%7B%22%24latest_traffic_source_type%22%3A%22%E7%9B%B4%E6%8E%A5%E6%B5%81%E9%87%8F%22%2C%22%24latest_search_keyword%22%3A%22%E6%9C%AA%E5%8F%96%E5%88%B0%E5%80%BC_%E7%9B%B4%E6%8E%A5%E6%89%93%E5%BC%80%22%2C%22%24latest_referrer%22%3A%22%22%7D%2C%22%24device_id%22%3A%221775a1b52a7957-06b8150f14079a-6915227c-2621440-1775a1b52a9b92%22%7D"
      },
      "referrer": "https://www.binance.com/en/nft/market",
      "referrerPolicy": "origin-when-cross-origin",
      "body": "{\"category\":0,\"keyword\":\"Childhood Fantasy Mystery Box\",\"orderBy\":\"list_time\",\"orderType\":-1,\"page\":1,\"rows\":100}",
      "method": "POST",
      "mode": "cors"
    })
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.data.rows
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )

    /*  this.setState(prevState => ({
        ...prevState,
        items : {
          ...prevState.items,
          coverUrl : "https://www.binance.com/"
        }
    }))
    console.log(this.state); */
  }

  render() {
    const { error, isLoaded, items } = this.state;

    const rows = items.map((row) => {
      const { productId, ...rest } = row;
      return { id: productId, ...rest };
    });

    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <div style={{ height: 1000 , width: "100%" }}>
          <DataGrid
            rows={rows}
            columns={columns}
            id="productId" 
            pageSize={100}
          />
        </div>
      );
    }
  }
}

export { App };


